    "1103202": {
        "Desc": "Habla con Huixin",
        "Talk": [
            [
                {
                    "N": "Huixin",
                    "T": "#Gracias por aceptar mi invitación, señorita Ganyu. Y a ustedes dos también, es un placer tenerl{F#as}{M#os} aquí."
                },
                {
                    "N": "_1005",
                    "T": "¡No es nada!"
                },
                {
                    "N": "Ganyu",
                    "T": "Eres muy amable por organizar todo esto, Huixin."
                },
                {
                    "N": "Huixin",
                    "T": "Jeje. En realidad... Aparte de darle las gracias por su ayuda, hay algo que me gustaría contarle..."
                },
                {
                    "N": "Ganyu",
                    "T": "¿Eh? Si hay algo en lo que pueda ayudarte, no dudes en decírmelo."
                },
                {
                    "N": "Huixin",
                    "T": "Ah... No, no, no necesito ayuda. Humm... ¿tiene un momento para escucharme?"
                },
                {
                    "N": "Ganyu",
                    "T": "Claro."
                },
                {
                    "N": "Huixin",
                    "T": "Jeje... Cuando era pequeña, mi papá solía contarme muchas historias sobre usted, señorita Ganyu."
                },
                {
                    "N": "Huixin",
                    "T": "Aunque respeto mucho a mi padre, siempre admiré lo amable y confiable que es usted."
                },
                {
                    "N": "Huixin",
                    "T": "De hecho, decidí trabajar en el Pabellón Yuehai porque siempre la he admirado mucho."
                },
                {
                    "N": "Ganyu",
                    "T": "No sabía que me tenías en tanta estima."
                },
                {
                    "N": "Huixin",
                    "T": "Sin embargo, trabajar en el Pabellón Yuehai resultó ser una ardua tarea."
                },
                {
                    "N": "Huixin",
                    "T": "No soy tan buena secretaria como usted, y a menudo dudo de mí misma..."
                },
                {
                    "N": "Ganyu",
                    "T": "No estoy de acuerdo. Creo que haces muy bien tu trabajo, Huixin."
                },
                {
                    "N": "Huixin",
                    "T": "Jiji, muchas gracias."
                },
                {
                    "N": "Huixin",
                    "T": "Pasados unos años, también tuve una hija."
                },
                {
                    "N": "_1005",
                    "T": "Vaya, ¡así que el Tío Tian ahora es el Abuelo Tian!"
                },
                {
                    "N": "Huixin",
                    "T": "Influenciada por mis ideales juveniles, quiere seguir mis pasos, y algún día llegará a ser secretaria del Pabellón Yuehai."
                },
                {
                    "N": "Huixin",
                    "T": "Al principio, estaba preocupada por ella porque no es un trabajo fácil. A decir verdad, todavía no estoy segura de que sea capaz de hacerlo."
                },
                {
                    "N": "Huixin",
                    "T": "Pero después de todo lo que ha pasado... He decidido apoyarla."
                },
                {
                    "N": "Ganyu",
                    "T": "Oh, ¿qué te hizo cambiar de opinión?"
                },
                {
                    "N": "Huixin",
                    "T": "El hecho de que la tendrá a usted, señorita Ganyu, como su superiora."
                },
                {
                    "N": "Huixin",
                    "T": "Sé que usted la ayudará amablemente y le dirá: “Tu mamá también era así”."
                },
                {
                    "N": "Huixin",
                    "T": "Será un momento tan hermoso..."
                },
                {
                    "N": "Huixin",
                    "T": "Si no es mucho pedir, es posible que ella necesite su ayuda dentro de veinte años."
                },
                {
                    "N": "Ganyu",
                    "T": "Huixin..."
                },
                {
                    "N": "Ganyu",
                    "T": "N-nunca pensé que yo significaba tanto para ti..."
                },
                {
                    "N": "Huixin",
                    "T": "Jeje, como cuando me enseñaste el truco de mi papá. Tenerte como “testigo” hace que la gente se sienta cómoda."
                },
                {
                    "N": "Ganyu",
                    "T": "¿Testigo?..."
                },
                {
                    "N": "Ganyu",
                    "T": "Es cierto que he sido testigo de miles de años de historia en Liyue. Todos los cambios que ha sufrido, las historias de su gente..."
                },
                {
                    "N": "Ganyu",
                    "T": "Pero nunca lo he considerado como nada más que la razón de mi soledad."
                },
                {
                    "N": "Ganyu",
                    "T": "Huixin, no sabes lo importante que es para mí todo lo que me has contado..."
                },
                {
                    "N": "Ganyu",
                    "T": "Has hecho que me dé cuenta de que comparto otra conexión con la gente de Liyue aparte de mi contrato con Rex Lapis."
                },
                {
                    "N": "Ganyu",
                    "T": "Confían en mí, me aceptan y desean que yo sea testigo de sus historias."
                },
                {
                    "N": "Huixin",
                    "T": "¡Por supuesto! Para nosotros, ¡usted es irremplazable!"
                },
                {
                    "N": "Ganyu",
                    "T": "Jeje, ya veo... Por eso no puedo decepcionar a nadie."
                },
                {
                    "N": "_1005",
                    "T": "¡Hurra! ¡Ganyu consiguió animarse un poco!"
                },
                {
                    "N": "Ganyu",
                    "T": "Aunque intenten echarme, seguiré luchando por mi lugar en Liyue."
                },
                {
                    "N": "Ganyu",
                    "T": "No te defraudaré. Cumpliré con mi contrato y seguiré trabajando como secretaria de las Siete Estrellas."
                },
                {
                    "N": "_0",
                    "T": "*Suspira*, ya te dije que nadie te echó..."
                },
                {
                    "N": "_0",
                    "T": "Nadie te echó. Fue un malentendido."
                },
                {
                    "N": "Ganyu",
                    "T": "Bueno, iré a ver qué ocurrió."
                },
                {
                    "N": "Ganyu",
                    "T": "Temo que todo se haya vuelto un desastre en mi ausencia."
                },
                {
                    "N": "Ganyu",
                    "T": "No hay tiempo que perder, ¡a trabajar!"
                },
                {
                    "N": "Huixin",
                    "T": "Mucha suerte, señorita Ganyu."
                },
                {
                    "N": "_1005",
                    "T": "¡¿Quééé?! ¿Ya nos vamos? ¡Paimon aún tiene hambre!"
                }
            ]
        ]
    },
